import {useState,useEffect} from "react";


function EffectTester(){

    const [count,setCount] = useState(0)

    useEffect(() => {
       document.getElementById('countClass').value = count
    }, [count]);
    function plusOneCount(){
        setCount(count+1)
    }


    return <div>

        <button onClick={plusOneCount}>plus one</button>
        <h1 className={'countClass'}>Count</h1>

    </div>
}

export default EffectTester;
